function real abs_real;
input real ip_val;
// return value = |ip_val|
 begin
 abs_real = (ip_val > 0) ? ip_val : -ip_val;
 end
endfunction //function abs_real


  parameter MAX_ERROR_COUNT = 3324; //uint32


 // Signals
  reg  clk; // boolean
  reg  clk_en; // boolean
  reg  reset; // boolean
  reg  [63:0] xin; // double
  wire [63:0] xout; // double

  reg  tb_enb; // boolean
  wire srcDone; // boolean
  wire snkDone; // boolean
  wire testFailure; // boolean
  reg  tbenb_dly; // boolean
  reg  rdEnb; // boolean
  wire xin_data_log_rdenb; // boolean
  reg  [11:0] xin_data_log_addr; // ufix12
  reg  xin_data_log_done; // boolean
  reg  xout_testFailure; // boolean
  integer xout_errCnt; // uint32
  wire delayLine_out; // boolean
  wire expected_ce_out; // boolean
  reg  int_delay_pipe [0:7] ; // boolean
  wire xout_rdenb; // boolean
  reg  [11:0] xout_addr; // ufix12
  reg  xout_done; // boolean
  wire [63:0] xout_ref; // double
  reg  check1_Done; // boolean

 // Module Instances
  filter u_filter
    (
    .clk(clk),
    .clk_en(clk_en),
    .reset(reset),
    .xin(xin),
    .xout(xout)
    );


 // Block Statements
  // -------------------------------------------------------------
  // Driving the test bench enable
  // -------------------------------------------------------------

  always @(reset, snkDone)
  begin
    if (reset == 1'b1)
      tb_enb <= 1'b0;
    else if (snkDone == 1'b0 )
      tb_enb <= 1'b1;
    else begin
    # (clk_period * 2);
      tb_enb <= 1'b0;
    end
  end

  always @(posedge clk or posedge reset) // completed_msg
  begin
    if (reset) begin 
       // Nothing to reset.
    end 
    else begin 
      if (snkDone == 1) begin
        if (testFailure == 0)
              $display("**************TEST COMPLETED (PASSED)**************");
        else
              $display("**************TEST COMPLETED (FAILED)**************");
      end
    end
  end // completed_msg;

  // -------------------------------------------------------------
  // System Clock (fast clock) and reset
  // -------------------------------------------------------------

  always  // clock generation
  begin // clk_gen
    clk <= 1'b1;
    # clk_high;
    clk <= 1'b0;
    # clk_low;
    if (snkDone == 1) begin
      clk <= 1'b1;
      # clk_high;
      clk <= 1'b0;
      # clk_low;
      $stop;
    end
  end  // clk_gen

  initial  // reset block
  begin // reset_gen
    reset <= 1'b1;
    # (clk_period * 2);
    @ (posedge clk);
    # (clk_hold);
    reset <= 1'b0;
  end  // reset_gen

  // -------------------------------------------------------------
  // Testbench clock enable
  // -------------------------------------------------------------

  always @ (posedge clk or posedge reset)
    begin: tb_enb_delay
      if (reset == 1'b1) begin
        tbenb_dly <= 1'b0;
      end
      else begin
        if (tb_enb == 1'b1) begin
          tbenb_dly <= tb_enb;
        end
      end
    end // tb_enb_delay

  always @(snkDone, tbenb_dly)
  begin
    if (snkDone == 0)
      rdEnb <= tbenb_dly;
    else
      rdEnb <= 0;
  end

  // -------------------------------------------------------------
  // Read the data and transmit it to the DUT
  // -------------------------------------------------------------

  always @(posedge clk or posedge reset)
  begin
    xin_data_log_task(clk,reset,
                      xin_data_log_rdenb,xin_data_log_addr,
                      xin_data_log_done);
  end

  assign xin_data_log_rdenb = rdEnb;

  always @ (xin_data_log_rdenb, xin_data_log_addr)
  begin // stimuli_xin_data_log_xin
    if (xin_data_log_rdenb == 1) begin
      xin <= # clk_hold xin_data_log_force[xin_data_log_addr];
    end
  end // stimuli_xin_data_log_xin

  // -------------------------------------------------------------
  // Create done signal for Input data
  // -------------------------------------------------------------

  assign srcDone = xin_data_log_done;


  always @( posedge clk or posedge reset)
    begin: ceout_delayLine
      if (reset == 1'b1) begin
        int_delay_pipe[0] <= 1'b0;
        int_delay_pipe[1] <= 1'b0;
        int_delay_pipe[2] <= 1'b0;
        int_delay_pipe[3] <= 1'b0;
        int_delay_pipe[4] <= 1'b0;
        int_delay_pipe[5] <= 1'b0;
        int_delay_pipe[6] <= 1'b0;
        int_delay_pipe[7] <= 1'b0;
      end
      else begin
        if (clk_en == 1'b1) begin
        int_delay_pipe[0] <= rdEnb;
        int_delay_pipe[1] <= int_delay_pipe[0];
        int_delay_pipe[2] <= int_delay_pipe[1];
        int_delay_pipe[3] <= int_delay_pipe[2];
        int_delay_pipe[4] <= int_delay_pipe[3];
        int_delay_pipe[5] <= int_delay_pipe[4];
        int_delay_pipe[6] <= int_delay_pipe[5];
        int_delay_pipe[7] <= int_delay_pipe[6];
        end
      end
    end // ceout_delayLine

  assign delayLine_out = int_delay_pipe[7];

  assign expected_ce_out =  delayLine_out & clk_en;

  // -------------------------------------------------------------
  //  Checker: Checking the data received from the DUT.
  // -------------------------------------------------------------

  always @(posedge clk or posedge reset)
  begin
    xout_task(clk,reset,
              xout_rdenb,xout_addr,
              xout_done);
  end

  assign xout_rdenb = expected_ce_out;

  assign xout_ref = xout_expected[xout_addr];


  always @ (posedge clk or posedge reset) // checker_xout
  begin
    if (reset == 1) begin
      xout_testFailure <= 0;
      xout_errCnt <= 0;
    end 
    else begin 
      if (xout_rdenb == 1 ) begin 
        if (abs_real($bitstoreal(xout) - xout_expected[xout_addr]) > 1.0e-9) begin
           xout_errCnt <= xout_errCnt + 1;
           xout_testFailure <= 1;
               $display("ERROR in xout at time %t : Expected '%f' Actual '%f'", 
                    $time, xout_expected[xout_addr], $bitstoreal(xout));
           if (xout_errCnt >= MAX_ERROR_COUNT) 
             $display("Warning: Number of errors for xout have exceeded the maximum error limit");
        end

      end
    end
  end // checker_xout

  always @ (posedge clk or posedge reset) // checkDone_1
  begin
    if (reset == 1)
      check1_Done <= 0;
    else if ((check1_Done == 0) && (xout_done == 1) && (xout_rdenb == 1))
      check1_Done <= 1;
  end

  // -------------------------------------------------------------
  // Create done and test failure signal for output data
  // -------------------------------------------------------------

  assign snkDone = check1_Done;

  assign testFailure = xout_testFailure;

  // -------------------------------------------------------------
  // Global clock enable
  // -------------------------------------------------------------
  always @(snkDone, tbenb_dly)
  begin
    if (snkDone == 0)
      # clk_hold clk_en <= tbenb_dly;
    else
      # clk_hold clk_en <= 0;
  end

 // Assignment Statements



endmodule // filter_tb
